import React from "react";
import { Footer, Navbar } from "../navfoot/navbar";
import { Link } from "react-router-dom";
export const Admindashboard=()=>
{
    return(
        <>
        <Navbar/>
        <div className="home">
            <div className="dash">
                <aside>
                    <Link to='/dashbo'></Link>
                </aside>
                <section></section>
            </div>
        </div>
        <Footer/>
        </>
    )
}
